                            <circle dx={50} dy={50} r={40}/>
                        </svg>
                    </div>
                )}
            </Spring>
            */
        );
    };

    render() {
        return(
            <div className={"aniHeader"}>
                {this.animate}
            </div>
        );
    }
}

export default App;
